export type InputType = 'TEXT' | 'DATE' | 'COUNTRY' | 'NATIONALITY' | 'NUMBER' | 'EMAIL' | 'PHONE' | 'CPF' | 'NAME' | 'YESNO' | 'SELECT';
export type Question = {
    questionId: string;
    isPredefined: boolean;
    inputType?: InputType;
    question: string;
    overrides?: InputType;
    options?: string[];
};
export type Screen = {
    title?: string;
    hideTitle: boolean;
    questions: Question[];
};
